Pour retirer les guillemets d'une chaîne de caractères en JavaScript, vous pouvez utiliser la méthode `replace()` pour remplacer les guillemets par une chaîne vide. Voici un exemple :

```javascript
const url = "http://localhost:5174/";
const urlSansGuillemets = url.replace(/"/g, '');
console.log(urlSansGuillemets);
```

Cependant, dans ce cas précis, les guillemets sont utilisés pour définir la chaîne, donc si vous voulez juste utiliser l'URL sans les guillemets dans votre code, vous pouvez simplement l'utiliser directement sans les guillemets :

```javascript
const url = "http://localhost:5174/"; // Ici, les guillemets sont nécessaires pour définir la chaîne
console.log(url);
```

Si vous avez une chaîne qui contient des guillemets et que vous souhaitez les retirer, la méthode `replace()` est la solution.
